pub fn category(code_point: u21) Category {
  return category_block[category_index[code_point >> 8]][code_point % 0x100];
}

pub const CategorySet = struct {
  content: u30,

  pub fn contains(s: CategorySet, c: Category) bool {
    return (s.content & (@as(u30, 1) << @enumToInt(c))) != 0;
  }

  pub fn create(included: anytype) CategorySet {
    var ret = empty();
    inline for (included) |c| {
      ret.content |= @as(u30, 1) << @enumToInt(@as(Category, c));
    }
    return ret;
  }

  pub fn empty() CategorySet {
    return .{.content = 0};
  }

  pub fn include(s: *CategorySet, c: Category) void {
    s.content |= @as(u30, 1) << @enumToInt(c);
  }

  pub fn includeSet(s: *CategorySet, other: CategorySet) void {
    s.content |= other.content;
  }
};

pub const Lut = CategorySet.create(.{.Lu, .Lt});
pub const LC = CategorySet.create(.{.Lu, .Ll, .Lt});
pub const L = CategorySet.create(.{.Lu, .Ll, .Lt, .Lm, .Lo});
pub const M = CategorySet.create(.{.Mc, .Me, .Mn});
pub const P = CategorySet.create(.{.Pc, .Pd, .Pe, .Pf, .Pi, .Po, .Ps});
pub const S = CategorySet.create(.{.Sc, .Sk, .Sm, .So});
pub const MPS = CategorySet{.content = M.content | P.content | S.content};

test "character categories" {
  try std.testing.expectEqual(Category.Ll, category('f'));
  try std.testing.expectEqual(Category.Lu, category('G'));
  try std.testing.expectEqual(Category.Po, category(','));
  try std.testing.expectEqual(Category.Sc, category('$'));
}

pub const EncodedCharacter = struct {
  buffer: [4]u8,
  len: u3,

  pub fn init(character: u21) EncodedCharacter {
    var ret: EncodedCharacter = undefined;
    ret.len = std.unicode.utf8Encode(character, &ret.buffer) catch unreachable;
    return ret;
  }

  pub fn repr(self: *const EncodedCharacter) []const u8 {
    return self.buffer[0..self.len];
  }
};